import { View, Text, Image, StyleSheet } from 'react-native';

export default function Welcome({ navigation }:any) {
    setTimeout(()=>{
        navigation.navigate('home')
    },1000)
    return (
        <View style={sheet.container}>
            <Image source={require("../assets/images/logo.png")} style={{ height: "200px", width: "200px" }} />
            <View style={{width:"auto",margin:"0 auto"}}>
                <View style={{height:"11px",width:"11px",borderRadius:50,backgroundColor:"#F8B720",marginLeft:"auto",marginRight:"11px",marginBottom:'-20px'}}></View>
                <Text style={sheet.text}>Paserv<Text style={{fontSize:50,fontWeight:"900"}}>l</Text></Text>
            </View>
        </View>
    );
}

const sheet = StyleSheet.create({
    container: {
        flex: 1,
        backgroundColor: "#1C39CE",
        justifyContent: "center",
        alignItems: "center"
    },
    text: {
        fontSize: 70,
        color: "#fff",
        fontFamily: "Courier New",
        fontWeight: "900",
        margin:"auto"
    }
})
